import axios from 'axios';
import React from 'react';
import { useState, useEffect } from 'react';

const url = 'https://api.elrond.com/nfts?size=10000&collection=EQUISTAR-3f393f';

function getNfts() {
  axios.get(url).then((res) => {
      return res.data;
    });
}

export { getNfts };
